<!-- &quot;A class to demonstrate mistakes made with setting\na property domain. The property hasTopping has a\ndomain of Pizza. This means that the reasoner can\ninfer that all individuals using the hasTopping\nproperty must be of type Pizza. Because of the\nrestriction on this class, all members of IceCream\nmust use the hasTopping property, and therefore\nmust also be members of Pizza. However, Pizza and\nIceCream are disjoint, so this causes an\ninconsistency. If they were not disjoint, IceCream\nwould be inferred to be a subclass of Pizza.&quot; -->
<g id="node1877" class="node"><title>"A class to demonstrate mistakes made with setting\na property domain. The property hasTopping has a\ndomain of Pizza. This means that the reasoner can\ninfer that all individuals using the hasTopping\nproperty must be of type Pizza. Because of the\nrestriction on this class, all members of IceCream\nmust use the hasTopping property, and therefore\nmust also be members of Pizza. However, Pizza and\nIceCream are disjoint, so this causes an\ninconsistency. If they were not disjoint, IceCream\nwould be inferred to be a subclass of Pizza."</title>
<text text-anchor="middle" x="12211" y="-998.5">"A class to demonstrate mistakes made with setting</text>
<text text-anchor="middle" x="12211" y="-985.5">a property domain. The property hasTopping has a</text>

<text text-anchor="middle" x="12211" y="-959.5">infer that all individuals using the hasTopping</text>
<text text-anchor="middle" x="12211" y="-946.5">property must be of type Pizza. Because of the</text>
<text text-anchor="middle" x="12211" y="-933.5">restriction on this class, all members of IceCream</text>
<text text-anchor="middle" x="12211" y="-920.5">must use the hasTopping property, and therefore</text>
<text text-anchor="middle" x="12211" y="-907.5">must also be members of Pizza. However, Pizza and</text>
<text text-anchor="middle" x="12211" y="-894.5">IceCream are disjoint, so this causes an</text>
